import React from 'react';

import classes from './Car.module.css';

const car = (props) => {
    let timeSince = (time) => {
        const currentTime = new Date().toTimeString();

        const hours = currentTime.slice(0,1) - time.slice(0,1);
    }
    return (
        <div className={classes.Car}>
            {props.ticket}
        </div>
    )
}

export default car;
